function MainSectionAbout() {
    return (
        <section className="section section2 about" id="about">
            <div className="main-title">
                <h2>About <span>me</span><span className="bg-text">my stats</span></h2>
            </div>
        </section>
    );
}

export default MainSectionAbout;
